import React from 'react'
import { useDispatch, useSelector } from 'react-redux'

const Demo = () => {

    const dispatch = useDispatch()
    const todos = useSelector((state)=>{
        return state;
    })


  return (
    <div>{todos}</div>
  )
}

export default Demo
